import React from 'react';
import './App.css';
import RickMorty from "./components/RickMorty";


function App() {
  return (
    <div className="App">
      <div>
        <h1>Mine favoritter</h1>
        <main>
          <RickMorty navn="Lynvingen" url="./img/lynvingen.jpg" />
          <RickMorty navn="Månestråle" url="./img/maanestraale.jpg" />
          <RickMorty navn="Supermann" url="./img/supermann.jpg" />
        </main>  
      </div>   
    </div>
  );
}

export default App;
